soup = BeautifulSoup(html)

def getRows(soup):
    rowSoup = soup.find('td', class_='nmtl').find('tbody')

    rows = []
    for tableRow in rowSoup.find_all('tr'):
        arr = []
        for tableData in tableRow.find_all('td'):
            if 'num' in tableData.attrs['class']:
                arr.append(int(tableData.find('div').contents[0]))
        rows.append(arr)
    return rows

def getCols(soup):
    colSoup = soup.find('td', class_='nmtt').find('tbody')

    cols = []
    for tableRow in colSoup.find_all('tr'):
        row = []
        for tableData in tableRow.find_all('td'):
            if 'num' in tableData.attrs['class']:
                row.append(int(tableData.find('div').contents[0]))
            else:
                row.append(0)
        cols.append(row)

    temp = [[] for _ in cols[0]]
    for i in range(len(temp)):
        for j in range(len(cols)):
            if cols[j][i] > 0:
                temp[i].append(cols[j][i])
    cols = temp
    return cols
    
rows = getRows(soup)
cols = getCols(soup)
print('rows')
print(rows)
print('cols')
print(cols)
print(f'size {len(rows)} * {len(cols)}')